import React from 'react';
import '../components/GroupChats.css'; // CSS file for styling

const ExploreGC = () => {
    return (
    //      <div className="group-chats-container">
    //     <div className="header">Explore Group Chats</div>
    //     <div className="chat-list">
    //       {/* Chat cards go here */}
    //     </div>
    //   </div>
      <div className="chat-container">
        <div className="chat-box">
          <h2>Local Jazz Bars: Four Members</h2>
          <p>
            Paris' jazz clubs are more than just music venues; they are a testament to the city's
            enduring love affair with jazz. Meet people to go to these clubs with, speak to them
            real-time about any questions.
          </p>
          <p>Paris, France</p>
          <p>Room Code: FPB</p>
        </div>
        <div className="chat-box">
          <h2>Markets: Seven Members</h2>
          <p>
            Santorini is known for its most gorgeous sunrises and sunsets with the view of endless
            ocean. Perfect place to plan a proposal or go for honeymoon. Local markets are authentic
            and beautiful. Explore Santorini like an insider.
          </p>
          <p>Santorini, Greece</p>
          <p>Room Code: FPB</p>
        </div>
        <div className="chat-box">
          <h2>Book Tours, Classes, Activities: Twelve Members</h2>
          <p>
            Turkey's beautiful Cappadocia has much to offer, ranging from its pottery classes,
            historical views, early morning hot air balloon sky, wine tasting, caves viewing, etc.
            Book slots through this group.
          </p>
          <p>Cappadocia, Turkey</p>
          <p>Room Code: FPB</p>
        </div>
      </div>
    );
  };

  export default ExploreGC;
